import React from 'react';

const Showcase= ()=>{
    return(
        
        <section className='shocase-container'>
            
           < div className='shocase-content'>
           <h1>Mejores Prductos Disponibles</h1>
           <p>Compra Calidad Al Mejor Precio </p>
           </div>
        </section>
    )
}
export default Showcase;
